const Rand = RandIntRange(1,1000);

const IsCommon = Rand < 700;
const IsUncommon = Rand >= 700 && Rand < 900;
const IsRare = Rand >= 900 && Rand < 980;
const IsHeroic = Rand >= 980 && Rand < 990;
const IsEpic = Rand >= 990 && Rand < 1000;
const IsLegendary = Rand == 1000;

SelectInt(IsCommon, 1, 
SelectInt(IsUncommon, 6, 
SelectInt(IsRare, 16, 
SelectInt(IsHeroic, 31, 
SelectInt(IsEpic, 51, 
SelectInt(IsLegendary, 71, 1))))))
